import React from 'react';
import styled from 'styled-components';
import TodoTitle from './TodoTitle';
import Todolist from './Todolist';

const Templatebox = styled.div`
  width : 500px;
  height : 760px;

  background : white;
  border-radius: 10px;
  margin: 0 auto;
  margin-top: 80px;

`

function Template () {
  return <Templatebox>
    <TodoTitle />
    <Todolist />
    </Templatebox>
}

export default Template;
